import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    container: {
        backgroundColor: '#fff',
        width: '100%',
        paddingHorizontal: 16,
        paddingVertical: 20,
        borderTopLeftRadius: 32,
        borderTopRightRadius: 32,
        height: '85%',
        // flexDirection: 'column',
        // justifyContent: 'space-between'
    },
    button: {
        paddingHorizontal: 20,
        paddingVertical: 10,
        borderColor: '#0a9b70',
        borderWidth: 1,
        borderRadius: 20,
        width: 200
    },
    ctnButton: {
        position: 'absolute',
        zIndex: 10,
        flexDirection: 'row',
        justifyContent: 'center',
        bottom: 28,
        width: '100%'
    },
    textInBold: {
        fontFamily: 'Inconsolata-Bold',
        fontSize: 24
    },
    textBtn: {
        fontFamily: 'Inconsolata-Medium',
        fontSize: 19,
        textAlign: 'center',
        color: '#0a9b70'
    },
    textDes: {
        fontFamily: 'Inconsolata-Bold',
        fontSize: 16,
        width: '80%',
        marginTop: 8,
        lineHeight: 24,
        color: '#0a9b70',
    },
});

export default styles;
